const PostItem = (props) => {
  return ( 
    <div className="post">
      <img className="post__img" src={props.post.img} alt="post"/>
        <span className="post__type">{props.tags}</span>
      <h2 className="post__title">{props.post.title}</h2>
      <div>
        <span className="post__autor">{props.post.autor}</span>
        <span className="post__date">{props.post.date}</span>
        <span className="post__views">{props.post.views}</span>
      </div>
      <p className="post__text">{props.post.text}</p>
    </div>
  );
}

export default PostItem;
